import Page from '../src/components/Page';

const About = () => (
  <Page>
    As the home of Austria's fighting game community, we provide a place to meet
    and get together with fighting game enthusiasts. Engage with people that
    share the same passion casually or participate in our local ranking
    tournaments.
  </Page>
);

export default About;
